  true,\n\t\"url\": null,\n\t\"notes\": \"Single-beam bathymetry and gravity data
  along with DGPS navigation data was collected as part of field activity L-13-82-WF
  in Juan de Fuca from 10/17/1982 to 10/29/1982, http://walrus.wr.usgs.gov/infobank/l/l1382wf/html/l-13-82-wf.meta.html
  These data are reformatted from space-delimited ASCII text files located in the
  Coastal and Marine Geology Program (CMGP) InfoBank field activity catalog at http://walrus.wr.usgs.gov/infobank/l/l1382wf/html/l-13-82-wf.bath.html
  and http://walrus.wr.usgs.gov/infobank/l/l1382wf/html/l-13-82-wf.grav.html into
  MGD77T format provided by the NOAA's National Geophysical Data Center(NGDC). The
  MGD77T format includes a header (documentation) file (.h77t) and a data file (.m77t).
  More information regarding this format can be found in the publication listed in
  the Cross_reference section of this metadata file.\",\n\t\"license_title\": \"Creative
